import React, { useState, useEffect } from 'react';
import '../styles/Chatbox.css';
import FileManager from './FileManager';
import { Client } from "@stomp/stompjs";
import axios from "axios";

const Chatbox = () => {
  const [messages, setMessages] = useState([]);
  const [input, setInput] = useState('');
  const [stompClient, setStompClient] = useState(null);
  const accessToken = localStorage.getItem("accessToken"); // ‚úÖ accessToken ÏÉÅÌÉú Ï†úÍ±∞, Î∞îÎ°ú ÏÇ¨Ïö©ÌïòÎèÑÎ°ù Î≥ÄÍ≤Ω

  useEffect(() => {
    console.log("‚úÖ Chatbox Ïª¥Ìè¨ÎÑåÌä∏ ÎßàÏö¥Ìä∏Îê® - useEffect Ïã§Ìñâ");

    if (!accessToken) {
      console.log("‚õî Î°úÍ∑∏Ïù∏ÌïòÏßÄ ÏïäÏùÄ ÏÉÅÌÉúÏóêÏÑúÎäî Secondary TokenÏùÑ ÏöîÏ≤≠Ìï† Ïàò ÏóÜÏäµÎãàÎã§.");
      return;
    }

    const connectWebSocket = async () => {
      try {
        console.log("üîç ÌòÑÏû¨ Access Token:", accessToken); 

        // ‚úÖ Secondary Token ÏöîÏ≤≠ Ïãú Authorization Ìó§Îçî Ìè¨Ìï® (ÏàòÏ†ïÎê®)
        const response = await axios.post("http://localhost:8082/api/user/secondary-token", {}, {
          headers: { Authorization: `Bearer ${accessToken}` }, // ‚úÖ ÏàòÏ†ïÎê®
          withCredentials: true
        });

        const secondaryToken = response.data.secondaryToken;
        console.log("‚úÖ Secondary Token:", secondaryToken);

        // ‚úÖ WebSocket Ïó∞Í≤∞ (Secondary Token Ìè¨Ìï®)
        const client = new Client({
          brokerURL: `ws://localhost:8082/ws?secondaryToken=${secondaryToken}`,
          reconnectDelay: 5000,
          onConnect: (frame) => {
            console.log("üü¢ WebSocket Ïó∞Í≤∞ ÏÑ±Í≥µ:", frame);

            // ‚úÖ Ï±ÑÌåÖÎ∞© Íµ¨ÎèÖ (teamId = 1 ÏòàÏãú)
            client.subscribe("/topic/chat/1", (message) => {
              const receivedMessage = JSON.parse(message.body);
              console.log("üì© ÏàòÏã†Îêú Î©îÏãúÏßÄ:", receivedMessage);
              setMessages((prevMessages) => [...prevMessages, receivedMessage]);
            });

            setStompClient(client); // ‚úÖ Stomp Client ÏÉÅÌÉú Ï†ÄÏû•
          },
          onStompError: (frame) => {
            console.error("‚õî WebSocket Ïó∞Í≤∞ Ïã§Ìå®:", frame);
          }
        });

        client.activate();
      } catch (error) {
        console.error("‚ùå Secondary Token ÏöîÏ≤≠ Ïã§Ìå®:", error);
      }
    };

    if (!stompClient) {
      connectWebSocket(); // ‚úÖ WebSocketÏù¥ ÏóÜÏùÑ ÎïåÎßå Ïã§Ìñâ (Ï§ëÎ≥µ Ïó∞Í≤∞ Î∞©ÏßÄ)
    }

    return () => {
      console.log("üî¥ Chatbox Ïñ∏ÎßàÏö¥Ìä∏Îê® - WebSocket Ï¢ÖÎ£å");
      if (stompClient) {
        stompClient.deactivate(); // ‚úÖ WebSocket Ìï¥Ï†ú (ÏàòÏ†ïÎê®)
        console.log("üî¥ WebSocket Ïó∞Í≤∞ Ï¢ÖÎ£å");
      }
    };
  }, [stompClient]); // ‚úÖ ÏùòÏ°¥ÏÑ± Î∞∞Ïó¥ÏùÑ stompClientÎ°ú Î≥ÄÍ≤Ω (Î∂àÌïÑÏöîÌïú Ïû¨Ïó∞Í≤∞ Î∞©ÏßÄ)

  const handleSend = () => {
    if (input.trim() && stompClient) {
      const message = { user: "You", content: input, teamId: 1 };
      stompClient.publish({ destination: "/app/chat/send", body: JSON.stringify(message) });
      setInput('');
    }
  };

  return (
    <div className="chatbox">
      <h3>Team Chat</h3>
      <div className="messages">
        {messages.map((msg, index) => (
          <p key={index}>
            <strong>{msg.user}: </strong>{msg.content}
          </p>
        ))}
      </div>
      <div className="input-area">
        <input
          type="text"
          value={input}
          onChange={(e) => setInput(e.target.value)}
          placeholder="Type a message"
        />
        <button onClick={handleSend}>Send</button>
      </div>
      <FileManager />
    </div>
  );
};

export default Chatbox;
